INSERT INTO `missionary_report` (`report_id`, `missionary_id`, `report_date`, `report`, `prayer_points`, `is_send`, `reporter_id`, `report_year`, `report_period`, `village_details`, `status`, `doc_link`, `photo_link`) VALUES
(1, 183, '2020-10-29', 'I thank God for his provision, protections and divine guidance in which he has led us successfully in all these month. As a family we are doing well. My children are very happy in the Lord. The presence of the Lord is making us more blessed and hopeful. In all these month I had spend more time with the Lord in prayer and fasting. I thank God for the NCM and for the financial support which is a great help for our survival and for the ministry. In all these days I could spend quality time with my wife and children.\r\n\r\nDue to the lock down we are not able to have meeting at church. But through conference call we are having meeting on every Sundays and Fridays. Regular fasting prayers are conducted with the help of mobile phone by sitting at our own houses. I thank God for all his blessing and guidance for the ministry. All our believers are doing well and more conscious about corona virus. We are also having regular Bible studies for all our church members.\r\n\r\nAs a NCM missionaries we are having blessed time in online worship and Bible studies through zoom. We all the missionaries are blessed by the Lord through this institution. Now days my mother is alone at house. I am the only child for her and the house where she is staying is almost demolished. The house roof is almost spoiled and walls are broken. Please pray for her and God may do great things for her.', '[\"Please pray for the ministry and God may help us to do more effectively\",\"Please pray for my mother and she is staying alone at a house which is demolished\",\"Please pray for my family and God may provide all our daily needs.\",\"Please pray for the island people to be delivered from the addiction of alcohols\",\"Please pray for the ministry and God may help us to do more effectively\",\"Please pray for my mother and she is staying alone at a house which is demolished\",\"Please pray for my family and God may provide all our daily needs.\"]', 0, 3, 2020, 2, '[[\"v1\",\"Diglipur\",\"92\",\"48\"],[\"v2\",\"Kalara\",\"21\",\"9\"],[\"v3\",\"Laxmipur\",\"24\",\"5\"],[\"v4\",\"Basadec\",\"34\",\"9\"],[\"v5\",\"Nabagram\",\"20\",\"3\"],[\"v6\",\"Ram nagar\",\"20\",\"9\"],[\"v7\",\"Kalighat\",\"10\",\"2\"]]', 1, 'http://app.the500k.com/uploads/missionary_report/', 'http://app.the500k.com/uploads/missionary_report/'),
(2, 386, '2020-11-04', 'I greet you in the name of our Lord and savior Jesus Christ. I give thanks to the Lord that He has kept me\r\nsafe and sound in the last month. I could grow more in faith by prayer, meditating the Word of God and\r\nthrough fasting prayer. The Lord is good at all the time. Physically me and all my family members are\r\ndoing well. In time of crisis the Lord is providing all our daily needs on time. Financially I was blessed\r\nthrough the support from the NCM. And because of your support I could survive during the time of lock\r\ndown and may the Lord continue to bless you more and more.\r\nNow days as you know that India is imposed lock down. Therefore we are not able to have meeting at\r\nchurch. Thus we are gathering for prayer by online and through conference call. Personally I have been\r\nfasting and praying for this village to be saved. Pray for Br. Manga singh, we shared the love of Christ to\r\nhim. Pray that God may change him and his family. All our church believers are doing well. \r\nFrom last month Br. Harjeet is backsliding from his faith but by Gods grace he is growing in the Lord\r\nand now he is actively participating in the services. Please pray that God my help him to grow more in the\r\nLord.\r\nThere is a brother named Soman and he was having stone in his kidney and we prayed for him. Now God\r\nhealed him completely. Glory to God.', '[\"Please pray for Sister Pinder. She is having cervical problem, May the God heal her completely. \",\"Pray for Br. Harjeet, he got a fever, May the Lord heal him\",\"Pray for Br. Rustam, he is going to get married, God may meet all the needs for him\",\"Pray for Sister Geeta, she is having severe headache, God may heal her.\",\"Pray for my Family, spiritual growth and ministry, God may use me for His mighty purpose.\",\"Please pray for Sister Pinder. She is having cervical problem, May the God heal her completely. \",\"Pray for Br. Harjeet, he got a fever, May the Lord heal him\",\"Pray for Br. Rustam, he is going to get married, God may meet all the needs for him\"]', 0, 3, 2020, 3, '[[\"v1\",\"TejaKalan\",\"8\",\"2\"],[\"v2\",\"Nepallien\",\"15\",\"4\"],[\"v3\",\"Thathay\",\"10\",\"\"]]', 1, 'http://app.the500k.com/uploads/missionary_report/', 'http://app.the500k.com/uploads/missionary_report/');
