INSERT INTO `missionary_six` (`id`, `FW_testimony`, `missionary_id`) VALUES
(4, 'By the grace of God, I could do my graduation, BA and later I also did B.Ed (Bachelor of Education).  I am married and God has blessed us with two children. \r\n\r\nI come from a Tribal background and was against the Christianity.  But God, in His great mercy gave me grace to realize my sinfulness.  I accepted the Lord as my personal saviour. \r\n\r\nThe Lord has laid a special burden to preach the Gospel.  Jesus Loves Ministry (JLM) has guided me in the ministry. ', 8),
(5, 'Greetings in the name of our lord and savior Jesus Christ.. My name is Samuel Ranjith Kumar , I was born and brought up in a middle class family in giddalur Prakasam district Andhra Pradesh.my parents were traditional Christians so it took me no time to know that Jesus is the true God as I grew up.. after finishing my class 12 I have gone to train up myself in Bible College I have finished my bachelor in divinity at Bethany Bible College.. I am married to Jyoti parimala and now we have two kids Rhema(8) and Rhemus(6)... Once I have met accidentally with some tribal people in a train. I was very much saddened to know about there faith in untrue gods. the burden towards them for me to make them know the real God has increased in me.. after spending in prayer for a lot of days I have decided by myself to go to the tribal areas to preach about the real God Jesus Christ. Since then I have started my ministry in the midst of the tribals near burujupalli, pedda cheruvu and venkatapuram. I would like to preach the word of God and make them know the true God until my last breath I would like to continue to spread the gospel of Jesus..\r\n	\r\n', 9),
(6, 'My name is R. Jeevaiah from Garapent village, I\'m chench tribe I was born in a Hindu family. I completed my B.tech civil engineering, I have four sisters. When i was four months old, I got sick, my parents has gone to so many Hindu temples and many Doctors but no use and I was not healed. one day, a pastor came to my village. That time my mom took me to the prayer meeting.   my mother was told  about my sickness. Pastor prayed for me  after that I got healed from my sickness. In my  young age I had many bad habits. Also I didn\'t get peace in my heart. one  day I went to church and I prayed to God. God showed me all my sins. That time I confessed my sins. I accepted Jesus Christ as my personal savior and after some days  I took Baptism. God has called me for His work. Later I joined Bethany Bible institute and have completed C.Th. Now I am Doing God\'s work.  please pray for my ministry and my family.\r\n\r\n', 10),
(7, 'My name is Sakru naik Deshavath, from sugali tribe. We live in nallamala forest. I am from very poor family and they are idolaters. We use to go to temples and serve them . We sacrifice animals and drink the blood because we heard from our forefathers and believed that we get supernatural powers. I got married and have 4 children. We don\'t like Jesus Christ we misunderstood that he is a foreign God. Here we have both male and female gods and we worship the idols which we keep in our houses. One day a pastor came and preached the Gospel saying that Jesus is true God and through him we get salvation . Said there wont be any response from idols because they don\'t see , listen, nor speak. After that i accepted Jesus Christ as my personal savior and took baptism. And me and my family got saved. And i got trained in word at Bethany Bible College. Please pray for my family and ministry.', 11),
(8, 'My Name is Yalakapati Prem Kumar, I belong to village called sundipenta from Kurnool dist. My father Pastor Y George was a pastor in Baptist Church. Since I had many friends , used to spend time with them and learnt all kinds of bad habits through them like, smoking, drinking alcohol etc. Many of the neighbors and villagers hated me because of my bad testimony being as pastor son. I had wrong relationships with other women. Everyone use to scold me because of bad habits . Even my family and relatives also dont love me. I got married in the year 1999. Due to my all bad habits , my thought to depart from me.  Since I lost because of all these , I thought to leave my life for many times. But during that time God\'s spirit was upon me and I prayed with tears. Slowly started going to church. My father who was the pastor preached saying Jesus Christ has come to this world to give peace to the humankind and if we can confess our sins , He will accept me and save us. Then I accepted Christ as my personal savior. Few days later , God called me to His service through this verse Matthew 28:19. And when I was praying for good Bible college, I have found Bethany Bible college. where I have studied for  two years and learnt many things , especially how to preach the gospel.  so now I am going and preaching in different villages. I have made a decision to live and serve God as long as I live. Currently I am serving God with all my family.', 13),
(9, 'My name is Mathaiah s/o chinna devayya I am from sinkesulla I have two brothers one sister I don\'t know Jesus is God. My parents are worshiped idols and we are eating the idol food. My young age started in sin life.  After a few days one of the God Servants came to my village and he spoke about the Gospel of Christ. At that time I accepted Jesus Christ as my personal savior, after a few days I took Baptism.\r\nAfter some years I am not going to the church and I am not attending  prayers.  When I stopped Church  I get sickness everyday blood is coming un urinal few days I don\'t see in my eyes. blindness is came in my life. I visited many hospitals but Doctors said no treatment to cure the eyes. no use take him home. after few weeks my wife died. that time I decide commit suicide that night I prayed to God. that time God spoke to me I forgive your sin,  you can do my ministry work, night time God touch my eyes my blindness is gone. Praise God. After I joined Bethany Bible institute am Completed  C.Th Course. I did not get married again, I am doing God\'s work..\r\nPlease pray for me and my children.\r\n ', 14),
(10, 'My Name is Singa Yesulu, My father\'s name is Rathnamayya. We are 5 brothers born to our parents. I am the youngest among all. I have lost my mother at the age of five years. My father took care of us. When I was 7 , I used to look after the herd. During my Child hood I suffered a lot for books, clothing, essentials etc because of our financial struggles. With that financial challenges,  I have completed my education till my Degree. I have learn all bad habits at the age of 15, like drinking alcohol, stealing, watching movies, taking drugs etc, which resulted in loosing my peace. Later I got married and I became a father of two children. One day Ps vijay kumar in his preaching, He said that Jesus Christ is the true living God and through Him We can be saved . So I confessed my sins and accepted  Jesus Christ as my Savior. Was regular to church after Baptized. Through the call of God, Completed my bible training in Betheny Bible college and continuing  ministry in many colleges.', 15),
(11, 'My name is Kondepogu Prasanna Kumar and I am from a small village called J C Agraharam.\r\nI have a mother, three sisters. We are daily labors. My parents did not accept Christ but still continuing with customs of Hindu religion. Even I dont know about Christ. I lived a sinful life in the world. Unfortunately my sister Jyothi passed away due to snake bite while she was sleeping . By that time she already got saved and even baptized. During her funeral a pastor from village came and preached that the dead in Christ will raise again and will have eternal life. During that time I was going through a thought  that about finding who is a true god. And few days I got married. Later , Once I was going to work along with my father, mother and my uncle, in a auto and we met with an accident .Immediately  I felt strongly  that \"what would happen to me if I die now\". Then I did a small prayer to Jesus Christ and made a vow that , if you save me , I will give my life to you. I remembered The words of the pastor Mr . Solomon who shared the gospel on my sister\'s funeral. God heard my prayer and healed all of us. Few days later I was invited to a open gospel meeting by pastor Bala Abraham. And I have been there. The Speak Mr claton preached that \" if anybody want  to be saved , they need to confess their sins and accept Jesus Christ as their personal savior. On that day I confessed my sins in prayer and received  Jesus Christ in my heart. On 23-03-2006 I got baptized by Ps Bala Abraham. From then I used to attend church regularly . Once I got  a vision and God compelled me to share the gospel. Then I have responded to the call and joined in a bible college and completed my B.D and started ministering. Since from a year I am continuing the work of God in some of the villages.\r\n', 16),
(12, 'I am V. Adham, from Cumbumpadu Village. I was born Hindu family where we worship the moon. I like snake god. I played drums in Hindu temples and Hindu festivals, we don\'t know  Jesus and I am living in sin and we enjoyed it. one day one pastor came to my village and the pastor preached the gospel, me and my friends creating some problems to stop the meeting. One day I got a sickness I went so many hospitals but there is no use one day pastor Sundhar singh is came to my village, he preaching John 5: 2 Now there is at Jerusalem by the sheep market a pool, which is called in the Hebrew tongue Bethesda, having five porches. and I lesion his words I repent my sins. After I went to that pastor\'s home I shared my sickness. He prayed  for me, I got healing  and I accepted Jesus Christ in  my personal savior after I took Baptism.\r\n\r\nAfter that I joined  Bethany Bible institute I completed C.Th course , now I am doing  God\'s work. please pray for my work and my family,( I have two children\'s) \r\n', 17),
(13, 'My name is R. Chandhra Shkhar,  I completed 10th class, I\'m chenchu tribe, we are living in the nallamalla forest, we use to worship idols, and I am  hunting the animals and eating that.  that only we have food and I like dramas, at my young age I spent my life doing what ever I wanted. One day one pastor gave a Gospel tract, I read it and I got to know and I believe in my heart Jesus is my Own savior, after that I received Jesus Christ and I took Baptism.\r\nAnd I joined Bethany Bible institute by call of God I completed C.Th course\r\n. Now I am doing God\'s work, please pray for my work and my family\r\n \r\n', 18),
(14, 'I am Akkem Pedda Jayaraju, from Singu palli village, I completed 10 +2 and teacher training, I have one brother and three sisters, I\'m came from very poor family and we are living nallamalla forest. my parents are idol worshipers and they drinking Alcohol , my father was  suffering devil spirits, because that reason Doctors also can\'t do anything after few days  one of the God Servant come to my home, he prayer for my father, that time all the devil spirits all come out and my father was healed in the name of Jesus Christ. in my young age I living in sin life that\'s way  I have no peace of mind,  one day one pastor came to my home he told about Jesus Christ, when I lesion that words peace came to my heart, after I got a salvation, I received Jesus Christ in my heart and I took Baptism. After that I joined Bethany Bible institute and I completed C.th Course. Now I am doing God\'s work, please prayer for my work and my family.', 19),
(15, 'My name is Veeradasu joseph, I have one boy and one girl I don\'t know  Jesus in my childhood and young age, I was addicted to many bad habits at my young age suddenly  I got a heart problem. Doctors said, you will die very soon, At  that time I went to church I share my problem to church pastor, he prayed for me immediately God healed me. I started going Church regularly. I have accepted Jesus Christ as  my personal savior and I repented my sins. I took Baptism.\r\nIn 2009 my wife passed away. In 2020 my 22 years daughter also passed away.  When God called me for His service. I joined the Bethany Bible institute and completed my B.Th.\r\nNow I am doing God\'s work.  Please pray for me and my son.\r\n', 20),
(16, 'My name is Popavath Rama Murthy Nayak S/O Bheemla Nayak, from Yarragundapalam, I\'m from the Lambadi tribes . We are living in the forest area.\r\nI\'m born and brought up in hindu religion family ,we worship all idol gods, we don\'t have good food in our home, and I enjoyed my life what I want and I did so many wrong  things. we don\'t know Jesus Christ that He is real God, one day pastor Jacob came to my village and he preach that Gospel of Jesus Christ, God touched my heart I believed Jesus Christ is real God, I confess my sins and I accepted Jesus Christ as my personal Savior. I took Baptism. \r\nI joined Bethany Bible Institute and I completed my B.D course,  please pray for me and my family.  \r\n\r\n', 21),
(17, 'My anme is Pedda abaulu naik. I belong to sugali tribe. we are hindus. We used to worship Idols. I was addicted to alcohol and lived according to sinful life. Once a pastor in my village preaching according to revelation 20:22, said will die eternally if we dont accept Jesus Christ as my personal Savior. I confessed to my sins and washed in the blood of Jesus Christ. Took baptism on 02-10-2010. God called me to ministry according Isaiah 43:1-3. Then i train my self in word through Bethany Bible Collage. And doing ministry now. Please pray for my ministry.', 22),
(18, 'My name is T.Suresh, from chinna Dhornala village I was born in very poor family, in my childhood I believe all God\'s are equal. I lived in sin life at my young age. I did not listen to my parents words,  one church in our village. one day I went to church, pastor preached the gospel ,that time the word of God touched my heart, after few days one night I prayed to God, God spoke to me through Psalm 32: 2. Blessed is the man unto whom the LORD imputeth not iniquity, and in whose spirit there is no guile.\r\n one night I confessed my sins in the presence of Jesus Christ and I accepted Jesus Christ as my own Savior in my life. On 10-01-2016 I took Baptism.\r\nAfter that I joined Bethany Bible institute, I completed C.Th .\r\nI am not married, please pray for me and my family.\r\n', 24),
(19, 'My name is David Raju and I am from Thimmapuram village Dhornala mandal. At my childhood i against to God my parents are doing work at Hindu temple at Srisailam, after few years  I got job in Hindu temple, I worshiped Hindu god\'s. every Thursday I went saibaba god temple and I worship, that time my parents was accepted Jesus Christ as own savior .my parents told me  told me come to the church do not worship idols but I can\'t listen  my father word\'s, one day my father took me to a church ,pastor was preaching the gospel. he preached about hell in that I got fear and I came back to the church, after few days I went one river with my friends for swim that river in that slowly I go to middle of river no-one helped me. that time I prayed  to Jesus to save me and said if you  save me I will  believe in you, the real God . when I prayed suddenly  one man came to me and saved me, after that I accept Jesus Christ as my personal savior. regularly I am going to the church. \r\nAfter one week I took Baptism and I joined Bethany Bible institute. I completed my C.Th.\r\nNow I am doing God\'s work.  Please pray for God\'s work and my family. (I have one boy and one girl)\r\n', 25),
(20, 'I am one of the four children born to my parents (Mr. Nagaiah and Mrs. Ramulamma).  we belong to Chenchu Community. We hail from Remidicherla, Chenchu Gudem.  I am married and we are blessed with two boys and a Girl.\r\n\r\nI was born in a idolatrous family.  After my marriage, I fell seriously sick, we went to many doctors and even to witch doctors.  But I was not healed.  During that time, an Evangelist came to our village ad he preached the Gospel.  I sought his prayers for my healing. I was miraculously healed and I was released from the oppression of the evil spirit as well.  Since then, I started attending prayer meetings. came to know more about the Gospel, accepted the Lord Jesus Christ as my personal Savior. \r\n\r\nI slowly started involving in the local Church ministry, travelled to many other places sharing my testimony. The Lord is using me.  The Lord graciously opened doors for me to study the Word of God at Bethel Bible Institute, Markapur.   Now I would like to serve Lord in Church planting ministry. ', 23),
(21, 'MY Name is Veeradasu Andraya. My parents are nominal Christians. We use to church. I was evil possessed in my childhood. Consulted many black magicians but of no use. Finally my parents have taken me to the church and made a vow that they would send me to ministry if he heals me. After few days Jesus Christ healed me. From then used to go church and help the ministers of God. Even after accepting  Jesus , lived a nominal Christian life but one day i was warned by the verse in 1 john 1:9. Then i confessed my sins and started a serious Christian life. And took baptism from Pastor Abraham. And I have completed my theological studies in Bethany Bible Institute . And continuing in ministry.', 26),
(22, 'I, Keshanapalli Galaiah, has studied upto 10th class.  I confessed my sins and accepted the Lord as I heard someone preaching the Gospel in my village.  As I was growing spiritually, the Lord laid a great burden in my heart towards the lost souls.  In obedience to God\'s call, I surrendered my life to full time Christian ministry.  The Lord opened doors for me to study at Bethel Bible Institute, Markapur.  I am preaching the Gospel among the tribal communities. ', 27),
(23, 'I have accepted the Lord Jesus Christ as my personal savior and Lord of my life. I surrendered my life to do His will in my life.  I have a clear calling from the Lord to preach the Gospel to the unreached people.', 28),
(24, 'I was born in a Christian family. My father, who is now with the Lord, was involved in the ministry.  Though he was working as a teacher, he used to go around many places preaching the Gospel.  When my father was preaching the Word of God in the Church, I was convicted of my sinfulness and repented of my sins. Thus I was brought to the salvation experience through my father. Later I got baptized. The Lord has called me to serve Him in full time ministry. ', 29),
(25, 'I was living in a remote village in nallamala forest. I was a idolater. By God\'s grace, some evangelists brought Gospel to our interior place.  As I was listening to message, the Lord brought a conviction in my heart of my sinfulness and I accepted the Lord Jesus Christ as my personal Saviour.  The Lord also called me to serve.  The Lord gave me an opportunity to study at Bethel Bible Institute. ', 30),
(26, 'I was born in a Christian family.  My parents became Christians even before I was born.  I came to know the Lord through the evangelistic ministry of my father. I am grateful to God. I got baptized and was serving the Lord. As the Lord has laid a burden for Church planting, I dedicated my life to preach the Gospel. ', 31),
(27, 'Since my childhood, I never heard about the Lord Jesus Christ. As I was growing, an evangelist came to our place and shared about the love of God. He explained the reason for the death of the Lord Jesus Christ on the Cross. It brought a conviction within my heart of my sinfulness. I confessed my sins and accepted the Lord. The Lord also helped me to study in the Bethel Bible Institute. I have a burden in involve in Church planting ministry.', 32),
(28, 'I was born in a idolatrous family. I was living in sin and I was addicted to sinful habits, from which I could not come out. I also fell seriously ill.  At such a time, a Pastor visited us and prayed for me.  I received healing.  I also realized that I was a sinner. My wife and i accepted the Lord as our personal savior.  We both got baptized.  The Lord is using us in the ministry. ', 33),
(29, 'I was born in a tribal family.  We were worshipping idols in the forest. When my wife was pregnant with the second child, she developed a strange disease, which could not be healed any where. Then we went to a near by Church, the Pastor prayed for my wife and she got healed. The Lord spoke to me. I accepted the Lord Jesus Christ as my personal savior. Now I am involved in Church planting ministry. ', 34);
